import axios from 'configs/axios';

export default {
	getData: (id) => axios.get('/offered-courses/', {id: id}),
	// getData: () => axios.get('/offered-courses/12'),

	myCourse: () => axios.get('/user-course'),
	DelMyCourse: (id) => axios.delete(`/user-course/${id}`),
};
